INSERT INTO `tbl_banner` (`banner_id`, `banner_title`, `banner_description`, `banner_img`, `banner_status`, `banner_order`) VALUES
(5, 'Time well spent', '<p>Good planning benefits everyone. At a glance you can see who&rsquo;s overloaded, who has time to take on more and then do something about it.</p>\r\n\r\n<p>Capacity lets you do more with what you have, it&rsquo;s productivity without the stress.</p>\r\n', '5_banner.jpg', '1', 1),
(6, 'Total visibility', '<p>There&rsquo;s nothing worse than over committing and under delivering.&nbsp;<span style="line-height: 1.6em;">With Capacity you and your team have total visibility over your&nbsp;workload, giving you the confidence to say yes and mean it.&nbsp;</span></p>\r\n', '6_banner.jpg', '1', 2),
(7, 'Organise people better', '<p>No matter what your people are doing, whether they&#39;re designing, coding, producing, creating, modelling, building, fixing, driving or selling, Capacity makes planning thier time easier.&nbsp;</p>\r\n\r\n<p>That means you can stop reacting and start winning!</p>\r\n', '7_banner.jpg', '1', 3);
