INSERT INTO `tbl_cms` (`cms_id`, `cms_name`, `cms_desc`, `cms_external_url`, `cms_position`, `cms_display_order`, `cms_meta_title`, `cms_meta_keyword`, `cms_meta_description`, `cms_publish`) VALUES
(1, 'THE WEB APP FOR RESOURCE MANAGEMENT', '<div class="col-sm-6 info">The ultimate tool for time and workflow management.&nbsp;Create teams, clients and projects. Set user roles and assign tasks.&nbsp;Capacity will help your business work smarter&nbsp;no matter what you do.</div>\r\n', '', 'About', 1, '', '', '', '1'),
(2, 'Control at a glance.', '<div class="col-sm-6 info">\r\n<p>In a world where everything moves fast, spreadsheets just aren&rsquo;t up to the task. Our app is designed to give you an instant understanding of the current capacity of your business.</p>\r\n\r\n<p>At a glance you can see who&rsquo;s booked up and who has the ability to take things on.</p>\r\n</div>\r\n', '', 'About', 2, '', '', '', '1');
