INSERT INTO `tbl_email_template` (`email_id`, `email_title`, `email_subject`, `email_body`, `email_status`) VALUES
(1, 'User Invitation ', 'Capacity Workflow App confirmation of registration.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi!</p>\r\n\r\n<p><br />\r\nYou&rsquo;ve been invited to join your fellow colleagues at {COMPANYNAME} and get started with the Capacity&trade; Workflow App. In no time you&rsquo;ll be up and running with a clear view of what you&rsquo;re working on and when. Just click on the link below to confirm your registration, and set up your account details.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>{LINK}</p>\r\n\r\n<p><br />\r\nThanks,<br />\r\nCapacity Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">Capacity Business Tools</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(2, 'Forgotpassword', 'Reset Password', '<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">{LOGO}</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">&nbsp;</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Hello {USERNAME},</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">&nbsp;</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;"><span style="line-height: 1.6em;">To create new password click {LINK}.</span></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;"><span style="line-height: 1.6em;">OR</span></p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">You can &#39;Copy&#39; and &#39;Paste&#39; below link:</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">{STATIC_LINK}</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">&nbsp;</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Thank You,</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Capacity.</p>\r\n\r\n<p style="color: rgb(51, 51, 51); font-family: sans-serif, Arial, Verdana, ''Trebuchet MS''; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20.7999992370605px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">Capacity Business Tools</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(3, 'Task add', 'Capacity Task Add', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hello {USERNAME},</p>\r\n\r\n<p>A Task has been Assign to you.</p>\r\n\r\n<p>{TASKDETAIL}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>thanks,</p>\r\n\r\n<p>Capacity Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(4, 'Task edit', 'Capacity Task Edit', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hello {USERNAME},</p>\r\n\r\n<p>Your Task has been edited.</p>\r\n\r\n<p>{TASKDETAIL}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>thanks,</p>\r\n\r\n<p>Capacity Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(5, 'Task move', 'Capacity Task Moved', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hello {USERNAME},</p>\r\n\r\n<p>Your task has been moved.</p>\r\n\r\n<p>{TASKDETAIL}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>thanks,</p>\r\n\r\n<p>Capacity Team.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(6, 'Contact us', 'You have a new message from a Capacity user.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi Capacity Team</p>\r\n\r\n<p>This is a message from one of your users, sent through the Contact Us form.<br />\r\nName: {NAME}<br />\r\nEmail: {EMAIL}<br />\r\nMessage: {MASSAGE}</p>\r\n\r\n<p>Thanks,<br />\r\nYour faithful Capacity robot.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(7, 'User Confirmation', 'Capacity Workflow App confirmation of registration.', '<p style="line-height: 20.7999992370605px;">{LOGO}</p>\r\n\r\n<p style="line-height: 20.7999992370605px;">&nbsp;</p>\r\n\r\n<p style="line-height: 20.7999992370605px;">Hi {NAME},<br />\r\nThanks for signing up to get started with the Capacity&trade; Workflow App. In no time you&rsquo;ll be up and running with a clear view of what your team is working on and when. Your login details are listed below, so keep a record of them on hand and just click the link below any time you want to access your account.</p>\r\n\r\n<p style="line-height: 20.7999992370605px;">Login: {EMAIL}<br />\r\nPassword: {PASSWORD}</p>\r\n\r\n<p style="line-height: 20.7999992370605px;">{LINK}</p>\r\n\r\n<p style="line-height: 20.7999992370605px;"><br />\r\nThanks,<br />\r\nCapacity Team</p>\r\n\r\n<p style="line-height: 20.7999992370605px;">&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(8, 'User Invitation Add new', 'Capacity Workflow App confirmation of registration.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {NAME}</p>\r\n\r\n<p><br />\r\nYou&rsquo;ve been invited to join your fellow colleagues at {COMPANYNAME} and get started with the Capacity&trade; Workflow App. In no time you&rsquo;ll be up and running with a clear view of what you&rsquo;re working on and when. Just click on the link below to confirm your registration and login details.</p>\r\n\r\n<p>Login: {EMAIL}<br />\r\nPassword: {PASSWORD}<br />\r\n{LINK}</p>\r\n\r\n<p><br />\r\nThanks,<br />\r\nCapacity Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(9, 'Free trial reminder', 'Your free trail for Capacity Workflow App is almost up.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {NAME},</p>\r\n\r\n<p><br />\r\nThanks for trying out the Capacity&trade; Workflow App! We hope it&rsquo;s been a great help in keeping track of your team and all their projects. I&rsquo;m sad to say though that your free trial ends on {DATE}. If you&rsquo;d like to continue using the app you can subscribe to one of three tailored plans for a low monthly fee. Just click the link below to check out the subscription options and keep those projects ticking like clockwork.<br />\r\nIf you have any questions about the subscription packages, or would like to request an extension to your free trail, please feel free to contact us.</p>\r\n\r\n<p>{SUBSCRIPTIONLINK}</p>\r\n\r\n<p><br />\r\nThanks,<br />\r\nCapacity Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(10, 'Error Processing Payment', 'We are having trouble processing your subscription to Capacity Workflow App.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {NAME},</p>\r\n\r\n<p>This is just a courtesy email to let you know that your monthly subscription to Capacity Workflow app was not renewed due to troubles processing your subscription payment. This could be because your credit card has expired. To make things a little less stressful, we will keep your Capacity account active for another 5 working days whilst you resolve the issue. After that your account will be put on hold.<br />\r\nHopefully you can sort this out by simply checking your credit card&nbsp;account details, but if you have any troubles feel free to <a href="http://www.capacityapp.net/contact-us">contact</a> us directly.</p>\r\n\r\n<p>Thanks,<br />\r\nCapacity Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">Capacity Business Tools</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(11, 'Account on hold', 'We are still unable to process your subscription to Capacity Workflow App.', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {NAME},</p>\r\n\r\n<p>This is a follow up email to let you know that your subscription payments to Capacity Workflow app are still unable to be processed. This could be because your credit card has expired. Your account is now on hold until you can resolve the issue.<br />\r\nHopefully you can sort this out by simply checking your credit card&nbsp;account details, but if you have any troubles feel free to <a href="http://www.capacityapp.net/contact-us">contact</a> us directly.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Thanks,<br />\r\nCapacity Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1'),
(12, 'Notification for task', 'Notification for task {TASKNAME}', '<p>{LOGO}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Hi {NAME},</p>\r\n\r\n<p>Your task {TASKNAME} is due to end in {HR} hours and {MN} minutes.<br />\r\nClient Name: {CLIENTNAME}<br />\r\nProject Name: {PROJECTNAME}<br />\r\nTask Description: {DESCRIPTION}<br />\r\nTask Ends: {ENDDATE}</p>\r\n\r\n<p><br />\r\n<a href="http://www.capacityapp.net">Click here</a> to access this task in Capacity Workflow app.</p>\r\n\r\n<p>Thanks,<br />\r\nCapacity Team</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div style="border-top: 2px solid #9CD779;width:100%;padding:10px 0;text-align:center"><a href="http://www.capacityapp.net" style=" text-decoration: underline;color:#CDCDCD">capacityapp.net</a> <a href="http://www.capacityapp.net/contact-us" style=" text-decoration: underline;color:#CDCDCD">Contact Us</a></div>\r\n', '1');
