INSERT INTO `tbl_feature` (`ftr_id`, `ftr_title`, `ftr_description`, `ftr_img`, `ftr_status`, `ftr_order`) VALUES
(2, 'Click and drag task assignment', '<p>A new job has landed? Assign it to the right person at the right time simply&nbsp;by clicking and dragging.&nbsp;</p>\r\n', '2_feature.png', '1', 1),
(3, 'One-look capacity indicator', '<p>Each team member has a dynamic indicator showing how busy they are.&nbsp;At a glance you can see how much capacity they have remaining.</p>\r\n', '3_feature.png', '1', 2),
(4, 'Customisable views', '<p>Instantly filter&nbsp;your view by any combination of team, project and client. Switch between day, week and month views for each individual team member. With Capacity you can see everything at once or just what you need to focus on.&nbsp;</p>\r\n', '4_feature.png', '1', 3),
(5, 'Notifications', '<p>Users can set notifications for critical tasks. Never miss a critical milestone, set&nbsp;reminders via email or popup within the web app to alert you to the upcoming deadline.&nbsp;</p>\r\n', '5_feature.png', '1', 4),
(6, 'Queue', '<p>Drop unassigned tasks into a holding queue until&nbsp;resources become&nbsp;available.&nbsp;This allows you to keep track of all outstanding tasks and get a clear picture of pipeline and&nbsp;overflow.</p>\r\n', '6_feature.png', '1', 5),
(7, 'REPORTING', '<p>Understand the productivity of your business. Our reports are&nbsp;customisable by project, team and individual.&nbsp;</p>\r\n', '7_feature.png', '1', 6);
